import React, { useState } from "react";
import * as XLSX from "xlsx";

function DrugPriceHistory() {
  const [selectedFile, setSelectedFile] = useState(null);
  const [ingredientCode, setIngredientCode] = useState("");
  const [filteredData, setFilteredData] = useState([]);

  const handleFileUpload = (e) => {
    const file = e.target.files[0];
    setSelectedFile(file);
  };

  const handleProcess = () => {
    if (!selectedFile || !ingredientCode) {
      alert("ÌååÏùºÍ≥º Ï£ºÏÑ±Î∂ÑÏΩîÎìúÎ•º ÏûÖÎ†•Ìï¥Ï£ºÏÑ∏Ïöî.");
      return;
    }

    const reader = new FileReader();
    reader.onload = (e) => {
      const data = new Uint8Array(e.target.result);
      const workbook = XLSX.read(data, { type: "array" });
      const sheetName = workbook.SheetNames[0];
      const sheet = workbook.Sheets[sheetName];
      const jsonData = XLSX.utils.sheet_to_json(sheet);

      // Ï£ºÏÑ±Î∂ÑÏΩîÎìú ÌïÑÌÑ∞ÎßÅ
      const filtered = jsonData
        .filter((row) => row["Ï£ºÏÑ±Î∂ÑÏΩîÎìú"] === ingredientCode)
        .sort(
          (a, b) =>
            Number(b["Ï†ÅÏö©Í∞úÏãúÏùºÏûê"]) - Number(a["Ï†ÅÏö©Í∞úÏãúÏùºÏûê"])
        );

      // ÏÉÅÌïúÍ∞Ä Î≥ÄÌôîÏú® Í≥ÑÏÇ∞ Î∞è Ìï¥ÏÑ§ Î∂ôÏù¥Í∏∞
      let prevPrice = null;
      const processed = filtered.map((row, index) => {
        const currentPrice = Number(row["ÏÉÅÌïúÍ∞Ä"]);
        let rate = "";
        let explanation = "";

        if (prevPrice != null && prevPrice !== 0) {
          const diff = ((currentPrice - prevPrice) / prevPrice) * 100;
          rate = `${diff.toFixed(2)}%`;
        }

        // ÌäπÏàò Ìï¥ÏÑ§ ÏòàÏãú
        if (row["Ï†ÅÏö©Í∞úÏãúÏùºÏûê"] === 20120401) {
          explanation = `2007.01.01 Í∏∞Ï§Ä ÏïΩÍ∞Ä 787Ïõê ‚Üí 53.55% ÏïΩÍ∞Ä 421Ïõê`;
        }

        prevPrice = currentPrice;

        return {
          ...row,
          ÏïΩÍ∞ÄÎ≥ÄÌôîÏú®: rate,
          Ìï¥ÏÑ§: explanation,
        };
      });

      setFilteredData(processed);
    };

    reader.readAsArrayBuffer(selectedFile);
  };

  return (
    <div style={{ padding: "2rem" }}>
      <h2>üíä ÏïΩÍ∞Ä Ïù¥Î†• Ï°∞Ìöå ÏãúÏä§ÌÖú</h2>
      <p>
        1. Í∏âÏó¨Ïù¥Î†• ÏóëÏÖÄ ÌååÏùº ÏóÖÎ°úÎìú ‚Üí 2. Ï£ºÏÑ±Î∂ÑÏΩîÎìú ÏûÖÎ†• ‚Üí 3. Í≤∞Í≥º ÌôïÏù∏
      </p>
      <div style={{ marginBottom: "1rem" }}>
        <label>
          ÌååÏùº ÏÑ†ÌÉù:{" "}
          <input type="file" accept=".xlsx, .xls" onChange={handleFileUpload} />
        </label>
      </div>
      <div style={{ marginBottom: "1rem" }}>
        <input
          type="text"
          placeholder="Ï£ºÏÑ±Î∂ÑÏΩîÎìú ÏûÖÎ†• (Ïòà: 125002ATB)"
          value={ingredientCode}
          onChange={(e) => setIngredientCode(e.target.value)}
        />
        <button onClick={handleProcess}>Ï°∞Ìöå</button>
      </div>

      {filteredData.length > 0 && (
        <table border="1" cellPadding="5">
          <thead>
            <tr>
              {Object.keys(filteredData[0]).map((key) => (
                <th key={key}>{key}</th>
              ))}
            </tr>
          </thead>
          <tbody>
            {filteredData.map((row, idx) => (
              <tr key={idx}>
                {Object.values(row).map((val, i) => (
                  <td key={i}>{val}</td>
                ))}
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}

export default DrugPriceHistory;
